import { useDispatch } from 'react-redux'

class GetRequest {
  static async getHistory() {
    const dispatch = useDispatch()
    try {
      fetch('/his')
        .then(res => res.json())
        .then(res => dispatch(evalNumOperation))
    } catch (e) {
      throw new Error(e)
    }
  }
}

export default GetRequest
